import{_ as e,o as t,c as a,O as i}from"./chunks/framework.9482e208.js";const m=JSON.parse('{"title":"§ 3.2-6031 Definitions.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/3.2-6031.md","filePath":"vacode/3.2-6031.md"}'),n={name:"vacode/3.2-6031.md"},r=i('<h1 id="§-3-2-6031-definitions" tabindex="-1">§ 3.2-6031 Definitions. <a class="header-anchor" href="#§-3-2-6031-definitions" aria-label="Permalink to &quot;§ 3.2-6031 Definitions.&quot;">​</a></h1><p>As used in this article, unless the context requires a different meaning:</p><p>&quot;Garbage&quot; means animal and vegetable wastes resulting from the handling, preparation, cooking, and consumption of foods containing animal carcasses or parts thereof. The Commissioner may in his discretion exclude from this definition such wastes that have been heat treated to the extent that the resultant material is of a uniform consistency, contains by analysis not more than 10 percent moisture, and that he has determined to be nonputrescible. Such treated nonputrescible wastes shall be &quot;commercial feed&quot; as the term is defined in § <a href="http://law.lis.virginia.gov/vacode/3.2-4800/" target="_blank" rel="noreferrer">3.2-4800</a>, and shall be subject to the provisions of Chapter 48 (§ <a href="http://law.lis.virginia.gov/vacode/3.2-4800/" target="_blank" rel="noreferrer">3.2-4800</a> et seq.).</p><p>Code 1950, § 3-598.1; 1954, c. 506; 1956, c. 308; 1966, c. 702, § 3.1-758; 1970, c. 619; 1994, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?941+ful+CHAP0743" target="_blank" rel="noreferrer">743</a>; 2008, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?081+ful+CHAP0860" target="_blank" rel="noreferrer">860</a>.</p>',4),o=[r];function s(c,l,h,d,f,_){return t(),a("div",null,o)}const u=e(n,[["render",s]]);export{m as __pageData,u as default};
